    public function img(){
        try {
            $path = app()->getRootPath() . 'public';

            // 传入本地图片路径初始化
            $compressor = new ImageCompressor($path.'/upload/123.jpg');

            // 获取图片信息
            $imageInfo = $compressor->getInfo();
            echo "原始图片: {$imageInfo['width']}x{$imageInfo['height']}, {$imageInfo['mime']}\n";

            // 原比例压缩
            $compressor->compressProportionally(
                maxWidth: 1000,
                maxSize: 2097152, // 2MB
                outputPath: $path.'/upload/compressed.jpg',
                quality: 85
            );

            // 裁剪压缩 - 居中裁剪
            $compressor->cropAndCompress(
                targetWidth: 300,
                targetHeight: 300,
                cropMode: ImageCompressor::CROP_TOP,
                outputPath: $path.'/upload/cropped-top.jpg'
            );

            echo "图片处理完成";
        } catch (\Exception $e) {
            // 捕获并处理所有可能的错误
            echo "处理失败: " . $e->getMessage();
        }
    }
