    // 解密数据
    private static function decryptDate($str)
    {
        $key = "5hOwdHxpW0GOciqZ";
        $iv = "0102030405060708";

        // 将十六进制字符串转换为二进制
        $binaryData = hex2bin($str);
        // 使用AES-CBC-PKCS7解密
        return openssl_decrypt(
            $binaryData,
            'AES-128-CBC',  // 16字节密钥对应AES-128
            $key,
            OPENSSL_RAW_DATA,  // 输入是原始二进制数据
            $iv
        );
    }

    public function order(){
        // 文件路径
        $path = app()->getRootPath() . 'public/order.json';
        // 读取文件内容
        $jsonContent = file_get_contents($path);
        // 将JSON字符串解码为PHP对象或数组
        $_data = json_decode($jsonContent, true); // 第二个参数为true表示返回数组，false表示返回对象

        // 检查是否有错误发生
        if (json_last_error() !== JSON_ERROR_NONE) {
            echo '解析JSON时发生错误：' . json_last_error_msg();
        }
        $_list = $_data['data'];
        $data = [];
        foreach ($_list as $v){
            $v['created_at'] = strtotime($v['created_at']);
            if($v['endTime']){
                $v['endTime']    = strtotime($v['endTime']);
            }
            $v['goods_id']   = $v['item_id'];
            $v['goods_name'] = $v['item_name'];
            $v['uid'] = $v['user_id'];
            unset($v['user_id']);
            unset($v['order_id']);
            unset($v['item_id']);
            unset($v['item_name']);
            $data[] = $v;
        }
        $aa = (new Orders())->insertAll($data);
        dump($aa);
